import React, {Component} from 'react';
import './Hello.css'

class Hello extends Component {
    render () {
        return (
            <div className="f3 tc">  
                <h1>BITCH, I'm the Man !</h1>
                <p>I was down but I'm coming up <strong>STRONGER</strong> than ever, watch !  </p>
                <h2>{this.props.acknowledgement}</h2>
            </div>)
    }
}

export default Hello;
